(84, '', 'S', 'voting instructions', '', '<ul><li>Aquest correu és d’ús personal i intransferible.\nL’enllaç a la plataforma de vot l’identifica personalment. Si cedeix aquest correu a una altra persona, estarà permetent que algú altre voti en nom seu.</li> \n<li>Li recomanem que en el moment de votar ho faci sol, sense la presència de cap altra persona, per garantir la seva llibertat i secret de vot. </li>\n<li>Pot accedir a la plataforma de vot des de qualsevol ordinador o dispositiu electrònic des del qual pugui consultar aquest correu i connectar-te a Internet. </li>\n<li>Mediti abans d’emetre el seu vot. Un cop hagi votat no podrà esmenar-lo.</li>\n</ul>', '<ul><li>Éste correo es de uso personal e intransferible. El link a la plataforma de voto le identifica personalmente. Si cede este correo a otra persona, estará permitiendo que alguien vote en su nombre.</li> \n<li> Le recomendamos que en el momento de votar lo haga solo, sin la presencia de ninguna otra persona, para garantizar su libertad y secreto de voto. </li> \n<li>Puede acceder a la plataforma de voto desde cualquier ordenador o dispositivo electrónico desde el cual pueda consultar este correo y conectarse a Internet. </li> \n<li>Medite antes de emitir su voto. Una vez haya votado no podrá enmendarlo.\n</ul>', '6HTUNCXM-SOKOZ-2RLC3-4SU51YFT-KFIHYOZR', 'sergi@ezonebox.com', '2017-02-04 13:59:35', '2017-02-04 13:48:40', NULL, 0, 3, 3, '', '', '', ''),
